import React from "react";
import { Link } from "react-router-dom";

export default function TermsConditions() {
  return (
    <div className="bg-black text-white min-h-screen p-10 text-center">
      <h1 className="text-3xl font-bold text-amber-400 mb-6">الشروط والأحكام</h1>
      <p className="text-gray-300 mb-4">
        باستخدامك لموقع <strong>AMH STORE</strong> فإنك توافق على الشروط التالية:
      </p>
      <ul className="list-disc text-gray-400 text-right w-fit mx-auto mb-6">
        <li>يمنع بيع حسابات غير موثوقة المصدر.</li>
        <li>الأسعار قابلة للتغيير دون إشعار مسبق.</li>
        <li>المشتريات الرقمية لا تُسترجع بعد التسليم.</li>
      </ul>
      <Link to="/" className="text-blue-400 hover:text-amber-300">⬅ العودة إلى الصفحة الرئيسية</Link>
    </div>
  );
}
